🎬 FUERA DE AGENDA CON SUSANA GIMÉNEZ EN LA PRESENTACIÓN DE LOL

@LautaroMaislin estuvo presente en la avant premiere de la serie en formato reality show para Prime Video, en donde habló con la conductora del programa, Susana Giménez.

👉 La diva de los teléfonos reveló que tiene intenciones de volver a la televisión, evitó hablar de política y recordó el cenicerazo a 25 años de lo ocurrido.
